import React, {Component} from 'react';
import {
  Text,
  StyleSheet,
  View,
  ImageBackground,
  FlatList,
  ScrollView,
} from 'react-native';
import {welcomepagebackground} from '../../common/images';
import styled from 'styled-components/native';
import ResponsiveImage from 'react-native-responsive-image';
import {SafeAreaView} from 'react-native-safe-area-context';
import {
  heightPercentageToDP,
  widthPercentageToDP,
} from 'react-native-responsive-screen';
import {KeyboardAwareScrollView} from 'react-native-keyboard-aware-scrollview';
import {useNavigation, DrawerActions} from '@react-navigation/native';

import {
  menu,
  dots,
  wlcmimg,
  addimage,
  image9,
  image10,
  image11,
  image12,
  image13,
  image14,
  image15,
  bottomadd,
} from '../../common/images';
import {Right} from 'native-base';
import {lightYellow, White, ShadeYellow} from '../../common/colors';

import {TouchableOpacity} from 'react-native-gesture-handler';
import LinearGradient from 'react-native-linear-gradient';

const Voting2 = () => {
  const navigation = useNavigation();

  return (
    <>
      {/* <SafeAreaView /> */}
      <ScrollView>
        <BackgroundImage source={welcomepagebackground}>
          <WelcomeView>
            <WelcomeText>Welcome John</WelcomeText>
            <TouchableOpacity
              onPress={() => {
                navigation.dispatch(DrawerActions.openDrawer());
              }}>
              <MenuIcon source={menu} initHeight="30" initWidth="30" />
            </TouchableOpacity>
          </WelcomeView>

          <ScrollView
            contentContainerStyle={{flexGrow: 1}}
            showsVerticalScrollIndicator={false}>
            <MainView>
              <View>
                <FirstView>
                  <ImagesView
                    source={wlcmimg}
                    initHeight="150"
                    initWidth="255"
                    borderRadius={5}
                  />
                  <LinearGradientColor
